script: |
  super -f text -I q5189.spq | sort > q5189.out

inputs:
  - name: q5189.spq
    data: |
      SELECT ALL - col0 / 28 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col1 - + + col1 * + ( col1 ) IN ( + ( - + col1 ) + + col1, - col0 );
  - name: tab1

outputs:
  - name: q5189.out
    data: |
      -1
      -3
      -3
